import React from "react";
import "./Uploads.scss";
import Placeholder from '../../assets/Images/video-list-0.jpg'

function Uploads() {
  return (
    <div>
      <div className="divider"></div>
      <h1>Upload Video</h1>
      <div>
        <div className="divider"></div>
        <div>
          <img src={Placeholder} alt=""/>
        </div>
      </div>
    </div>
  );
}

export default Uploads;
